content=Of course the first thing to do was to make a grand survey of the country she was going to travel through. "It's something very like learning geography," thought Alice, as she stood on tiptoe in hopes of being able to see a little further. "Principal rivers -- there are none. Principal mountains -- I'm on the only one, but I don't think it's got any name. Principal towns -- why, what are those creatures, making honey down there?"

